import React from "react";

const ToDoForm = () => {
  return (
    <form className="todoform">
      <input
        type="text"
        className="todo-input"
        placeholder="What is the task today ?"
      ></input>
      <button type="submit" className="todo-btn">
        Add Task
      </button>
    </form>
  );
};

export default ToDoForm;
